@carrotpiebun @osscfc @OmoIyaaWese @Letter_to_Jack Two freekicks from each player I mentioned ☝️ there and you have a top 10 list that could scale through.

This Messi free-kick vs Liverpool was good, but won't fit in. At all!!

His 2012 Free-kick vs Atletico might fit in, if it was in the UCL.
